import React from "react";

function NotFoundPage() {
  return (
    <div
      style={{
        width: "100vw",
        height: 'calc(100vh - 70px)',
        fontSize: "100px",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      404 Not Found
    </div>
  );
}

export default NotFoundPage;
